const ContainerParent = styled.div`
  background-color: white;
`;

const ContainerStyled = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 100px;
  background-color: whitesmoke;
`;

const LeftContent = styled.div`
  flex: 1;
`;

const ImageBox = styled.img`
  border-radius: 50px;
  width: 300px;
  height: 300px;
`;

const RightContent = styled.div`
  flex: 1;
  text-align: left;
`;

const Introduction_Title = styled.p`
  font-size: 32px;
`;

const Introduction = styled.p`
  font-size: 16px;
`;

const Home = () => {
    return (
        <ContainerParent>
            <ContainerStyled>
                <LeftContent>
                    <ImageBox src="/profile.jpeg" />
                </LeftContent>
                <RightContent>
                    <Introduction_Title>My Name is Subin</Introduction_Title>
                    <Introduction>
                        안녕하세요, 저는 클라이언트 개발자이며, 그래픽과 웹 프론트엔드에 큰 관심을 가지고 있는 사람입니다. 웹 디자인과 사용자 경험을 개선하는 데 열정을 가지고 있습니다.
                    </Introduction>
                </RightContent>
            </ContainerStyled>
            <ButtonContainer>
                <Container>
                    <Row>
                        <Col>
                            <Button>버튼 1</Button>
                        </Col>
                        <Col>
                            <Button>버튼 2</Button>
                        </Col>
                    </Row>
                    <Partition></Partition>
                    <Row>
                        <Col>
                            <Button>버튼 3</Button>
                        </Col>
                        <Col>
                            <Button>버튼 4</Button>
                        </Col>
                    </Row>
                </Container>
            </ButtonContainer>
        </ContainerParent>
    );
};

export default Home;
